import React from "react";
import Navbar from "../resources/components/Navbar";

const Description = () => {
  return (
    <>
      <Navbar />
      <div className="job-desc-head">
        <div>Frontend Developer - React.js/TypeScript</div>
      </div>
    </>
  );
};

export default Description;
